var x = document.createElement('LINK');
var y = document.createElement('TITLE');
var active = 'data:image/png;base64,'+'';
var passive = 'data:image/png;base64,'+'';

x.setAttribute('rel', 'icon');
x.setAttribute('type', 'image/png');

$(window).focus(function(){init('Welcome back!', active)});
$(window).blur(function(){init('Sleeping Time!', passive)});

function init(message, url){
    y.write(message);
    x.setAttribute('href', url);
    document.head.appendChild(x);
    document.head.appendChild(y);
}